// src/routes.js
import React from 'react';
import { BrowserRouter as Router, Route, Switch as RouterSwitch } from 'react-router-dom'; // Utilisez un alias différent, par exemple "RouterSwitch"
import Home from './pages/Home';
import Appartements from './pages/Appartements';
import NotFound from './pages/NotFound';

const Routes = () => {
  return (
    <Router>
      <RouterSwitch> {/* Utilisez le composant RouterSwitch avec l'alias que vous avez choisi */}
        <Route exact path="/" component={Home} />
        <Route path="/appartements" component={Appartements} />
        <Route component={NotFound} />
      </RouterSwitch>
    </Router>
  );
};

export default Routes;
